import React from 'react';
import { styled } from 'styled-components';

const Container = styled.div`
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
`;

const Banner = styled.div`
  width: 100%;
  height: 30px;
  background-color: #000;
`;

const Content = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  border-bottom: 1px solid #eee;
`;

const Ul = styled.ul`
  display: flex;
  justify-content: center;
  align-items: center;
  list-style: none;
  padding: 0;
  li {
  }
`;

const Atag = styled.a`
  display: inline-block;
  text-decoration: none;
  color: #000;
  font-size: 12px;
  padding: 10px 20px;
`

const Header = () => {
  const leftNav = ['스토어', '룩북', '매거진', '브랜드 소개', 'NEW ARRIVAL', 'SWIM WEAR'];
  const rightNav = ['매장안내', '회원혜택', '검색', '로그인', '장바구니'];
  return (
    <Container>
      <Banner>WEEKLY BEST ITEM</Banner>
      <Content>
        <div>
          <Ul>
            {leftNav.map((item, index) => (
              <li><Atag href='#' key={index}>{item}</Atag></li>
            ))}
          </Ul>
        </div>
        <div>
          <img src='https://wiisnt.co.kr/images/cm_logo_1_02.svg' width={50}/>
        </div>
        <div>
          <Ul>
            {rightNav.map((item, index) => (
              <li><Atag href='#' key={index}>{item}</Atag></li>
            ))}
          </Ul>
        </div>
      </Content>
    </Container>
  )
}

export default Header;
